import React from 'react';

function Skills() {
  return (
    <div>
      <h1>Skills</h1>
      <ul>
        <li>[Skill 1]</li>
        <li>[Skill 2]</li>
        <li>[Skill 3]</li>
      </ul>
    </div>
  );
}

export default Skills;
